    """ Input to this function is a string containing multiple groups of nested parentheses. Your goal is to
    separate those group into separate strings and return the list of those. Separate groups are balanced (each open brace is properly closed) and not nested within each other
    Ignore any spaces in the input string.
    >>> separate_paren_groups('( ) (( )) (( )( ))')
    ['()', '(())', '(()())']
    """
    paren_stack = []
    paren_groups = []

    for char in paren_string:
        if char == '(':
            paren_stack.append(char)
        elif char == ')':
            if not paren_stack:
                return []
            paren_stack.pop()
            if not paren_stack:
                paren_groups.append(''.join(paren_stack))
                paren_stack = []

    if paren_stack:
        return []

    return paren_groups

