    ['()', '(())', '(()())']
    """

    def is_balanced(paren_string: str) -> bool:
        """ Helper function to check if a given string of parentheses is balanced """
        stack = []
        for c in paren_string:
            if c == '(':
                stack.append(c)
            elif c == ')':
                if not stack or stack.pop() != '(':
                    return False
        return not stack

    groups = []
    current_group = ''
    i = 0
    while i < len(paren_string):
        c = paren_string[i]
        if c == '(':
            if current_group:
                groups.append(current_group)
                current_group = ''
            current_group += c
        elif c == ')':
            if not is_balanced(current_group):
                return []
            current_group += c
            groups.append(current_group)
            current_group = ''
        i += 1

    if current_group:
        groups.append(current_group)

    return [g for g in groups if is_balanced(g)]

