def parse_nested_parens(paren_string: str) -> List[int]:
    """ Input to this function is a string represented multiple groups for nested parentheses separated by spaces.
    For each of the group, output the deepest level of nesting of parentheses.
    E.g. (()()) has maximum two levels of nesting while ((())) has three.

    >>> parse_nested_parens('(()()) ((())) () ((())()())')
    [2, 3, 1, 3]
    """

    def is_balanced(parens: str) -> bool:
        """ Check if the input string has balanced parentheses. """
        count = 0
        for c in parens:
            if c == '(':
                count += 1
            elif c == ')':
                count -= 1
                if count < 0:
                    return False
        return count == 0


    def max_level(parens: str) -> int:
        """ Find the maximum level of nesting for the input string. """
        max_level = 1
        level = 1
        for c in parens:
            if c == '(':
                level += 1
                max_level = max(max_level, level)
            elif c == ')':
                level -= 1
        return max_level


    result = []
    groups = paren_string.split()
    for group in groups:
        if is_balanced(group):
            result.append(max_level(group))
        else:
            result.append(0)
    return result

