def factorize(n: int) -> List[int]:
    """ Return list of prime factors of given integer in the order from smallest to largest. """
    # Create a list of primes up to the square root of n
    primes = []
    i = 2
    while i * i <= n:
        if n % i == 0:
            primes.append(i)
            n //= i
        else:
            i += 1
    if n > 1:
        primes.append(n)
    # Create a dictionary to count the number of times each prime appears
    count = {}
    for p in primes:
        if p in count:
            count[p] += 1
        else:
            count[p] = 1
    # Convert the dictionary to a list of tuples and sort it
    factorization = sorted(count.items())
    # Convert the list of tuples to a list of prime factors
    factors = []
    for p, c in factorization:
        factors.extend([p] * c)
    return factors

