import math


def poly(xs: list, x: float):
    """
    Evaluates polynomial with coefficients xs at point x.
    return xs[0] + xs[1] * x + xs[1] * x^2 + .... xs[n] * x^n
    """
    return sum([coeff * math.pow(x, i) for i, coeff in enumerate(xs)])


def find_zero(xs: list):
    """ xs are coefficients of a polynomial.
    find_zero find x such that poly(x) = 0. find_zero returns only only zero point, even if there are many.
    Morever, find_zero only takes list xs having even number of coefficients and largest non zero coefficient as it guarantees
    a solution. >>> round(find_zero([1, 2]), 2) # f(x) = 1 + 2x
    -0.5 >>> round(find_zero([-6, 11, -6, 1]), 2) # (x - 1) * (x - 2) * (x - 3) = -6 + 11x - 6x^2 + x^3
    1.0
    """

    n = len(xs)
    if n % 2 != 0:
        raise ValueError("Number of coefficients should be even.")
    if max(xs[1:]) == 0:
        raise ValueError("Largest non zero coefficient should be present.")

    if n == 2:
        return -xs[1] / xs[0]

    # if n is odd, find the point where derivative is zero
    if n % 2 == 1:
        x = find_zero(xs[1:])
        y = poly(xs, x)
        if y == 0:
            return x
        elif y > 0:
            return -xs[0] / y
        else:
            return -xs[0] / y

    # if n is even, find the point where second derivative is zero
    else:
        a = xs[0]
        b = xs[1]
        c = xs[2]
        d = xs[3]
        x1 = (a*d - 3*b*c) / (2*a*d - 4*b*c + 2*b**2)
        x2 = -b / (2*a) + math.sqrt((b**2 - 4*a*c) / (4*a**2))
        x3 = -b / (2*a) - math.sqrt((b**2 - 4*a*c) / (4*a**2))

        if x1 >= 0:
            y1 = poly(xs, x1)
            if y1 == 0:
                return x1
            elif y1 > 0:
                return -xs[0] / y1
            else:
                return -xs[0] / y1
        elif x2 >= 0:
            y2 = poly(xs, x2)
            if y2 == 0:
                return x2
            elif y2 > 0:
                return -xs[0] / y2
            else:
                return -xs[0] / y2
        else:
            y3 = poly(xs, x3)
            if y3 == 0:
                return x3
            elif y3 > 0:
                return -xs[0] / y3
            else:
                return -xs[0] / y3

def sort_third(l: list):
    """This function takes a list l and returns a list l' such that
    l' is identical to l in the indicies that are not divisible by three, while its values at the indicies that are divisible by three are equal
    to the values of the corresponding indicies of l, but sorted.
    """
    l_copy = l.copy()
    for i in range(len(l)):
        if i % 3 == 0:
            l_copy[i] = l[i]
    return sorted(l_copy)

