def int_to_mini_roman(number):
    roman_numerals = {
        1: 'i', 4: 'iv', 5: 'v', 9: 'ix',
        10: 'x', 40: 'xl', 50: 'l', 90: 'xc',
        100: 'c', 400: 'cd', 500: 'd', 900: 'cm',
        1000: 'm'
    }

    result = ''
    for value, roman_numeral in roman_numerals.items():
        while number >= value:
            result += roman_numeral
            number -= value

    return result.lower()

def int_to_mini_roman(number):
    # define the mapping from digits to roman numerals
    roman_map = {1: 'i', 4: 'iv', 5: 'v', 9: 'ix', 10: 'x', 40: 'xl', 50: 'l', 90: 'xc', 100: 'c', 400: 'cd', 500: 'd', 900: 'cm', 1000: 'm'}

    # convert the input number to a string and pad with leading zeros if necessary
    number_str = str(number).zfill(4)

    # iterate through the digits of the input number
    result = ''
    for i in range(len(number_str)):
        digit = int(number_str[i])

        # add the corresponding roman numeral to the result
        if digit == 0:
            continue
        elif i == 0 or digit <= 3:
            result += roman_map[digit]
        elif digit == 4:
            result += roman_map[1] + roman_map[4]
        elif digit == 5:
            result += roman_map[5]
        elif digit == 9:
            result += roman_map[1] + roman_map[9]
        else:
            result += roman_map[10] * (digit // 10)
            digit %= 10
            if digit > 0:
                result += roman_map[digit]

    return result.lower()

