def generate_integers(a, b):
    # Ensure a is the smaller number
    if a > b:
        a, b = b, a

    # Create an empty list to store even digits
    even_digits = []

    # Loop through the range of integers from a to b
    for num in range(a, b+1):
        # Convert the integer to a string so we can check each digit
        num_str = str(num)

        # Loop through each digit in the string
        for digit in num_str:
            # If the digit is even, add it to the even_digits list
            if int(digit) % 2 == 0:
                even_digits.append(int(digit))

    # Sort the even digits in ascending order and return the list
    return sorted(even_digits)
